import React from 'react';
import "./App.css"
import Navbar from "./Components/Navbar"
import Expenses from "./Components/Expenses/Expenses"
const App=()=> {
  const expense=[
    {
      title:"Car insurense",
      amount:"9456",
      data:new Date(2021,4,12)
    },
    {
      title:"Car insurense",
      amount:"9456",
      data:new Date(2021,4,12)
    },
    {
      title:"Car insurense",
      amount:"9456",
      data:new Date(2021,4,12)
    },
    {
      title:"Car insurense",
      amount:"9456",
      data:new Date(2021,4,12)
    },
  ];
  return (
    <div>
    <Navbar/>
    <Expenses title={expense[0].title} amount={expense[1].amount} date={expense[2].date}/>
    <Expenses/>
    <Expenses/>
    <Expenses/>
    </div>
  );
}
export default App;
